```solidity
pragma solidity ^0.8.20;

contract MyContract {
    mapping (address => uint256) private _balanceOf;
    mapping (address => mapping (address => uint256)) private _allowance;
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    event MaxTxAmountUpdated(uint256 maxTxAmount);
    event Approval(address indexed owner, address indexed spender, uint256 value);
    event Transfer(address indexed from, address indexed to, uint256 value);

    constructor(address owner_) {
        _owner = owner_;
        emit OwnershipTransferred(address(0), _owner);
    }

    function _SafeSub(uint256 varg1, uint256 varg2) private pure returns (uint256) {
        require(varg1 >= varg2, "arithmetic underflow");
        return varg1 - varg2;
    }

    function approve(address spender, uint256 value) external returns (bool) {
        _allowance[msg.sender][spender] = value;
        emit Approval(msg.sender, spender, value);
        return true;
    }

    function transferFrom(address from, address to, uint256 value) external returns (bool) {
        require(value <= _balanceOf[from], "Insufficient balance");
        require(value <= _allowance[from][msg.sender], "Insufficient allowance");

        _balanceOf[from] -= value;
        _balanceOf[to] += value;
        _allowance[from][msg.sender] -= value;
        emit Transfer(from, to, value);

        return true;
    }

    function transfer(address to, uint256 value) external returns (bool) {
        require(value <= _balanceOf[msg.sender], "Insufficient balance");

        _balanceOf[msg.sender] -= value;
        _balanceOf[to] += value;
        emit Transfer(msg.sender, to, value);

        return true;
    }

    function balanceOf(address owner) external view returns (uint256) {
        return _balanceOf[owner];
    }

    function allowance(address owner, address spender) external view returns (uint256) {
        return _allowance[owner][spender];
    }
}
```

